// 2da pagina creada:
// Misma estructura que "Cursos.tsx"
import React from 'react'

import {
  IonContent,
  IonHeader,
  IonPage,
  IonTitle,
  IonToolbar,
  IonButtons,
  IonBackButton,
} from '@ionic/react'

const Objetivos: React.FC = () => {
  return (
    <IonPage>
      <IonHeader> 
        <IonToolbar>
          <IonButtons slot='start'>
            <IonBackButton defaultHref=""/>
          </IonButtons>
          <IonTitle>OBJETIVOS</IonTitle>
        </IonToolbar>

        <IonContent>
          <h2>Pagina de Objetivos</h2>
        </IonContent>
      </IonHeader>
    </IonPage>
  )
}

export default Objetivos

// IonPage = necesario para componentes lugadoa a traves de routing deben estar dentro
// slot = indicar donde posicionar el "back button" dentro del toolbar (start = izquierda)
